    [],nt"revision_timestamp": "2016-07-27T22:52:31.111460",nt"name": "quivira-national-wildlife-refuge-narrative-report-january-1-to-december-31-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Quivira
    National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, and
    vegetation control. Resource management is outlined; topics include grazing and
    haying. A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, violations, and safety. Items of interest and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
